import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';
import { typography } from '@material-ui/system';



const styles = {
    paper: {
        padding : "15px",
        margin : "5px",
        marginBottom : "10px"
    }
}

export default ({exercises}) => {
    return (
        <div>
        <Grid container>
            <Grid item xs>
                <Paper style = {styles.paper}>
                    {exercises.map(([group, items]) => {
                        return (
                    <Typography component = "block" variant="h5">{group.toUpperCase()}</Typography>
                        )
                    } )
                    }
                </Paper>
        </Grid>
        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "button" >Right Panel
                    </Typography>
                </Paper>
        </Grid>

        </Grid>
        </div>
    )
}
